import React from "react";
import styled, { keyframes } from "styled-components";
import { Link, useNavigate } from "react-router-dom";
import { FaPlaneDeparture, FaHotel, FaCalendarCheck, FaMapMarkedAlt } from "react-icons/fa";

/* ------------------------------------------------------------------
 *  Bookify â€“ landing page after login
 * ------------------------------------------------------------------
 *  â€¢ Sticky header with logo + nav (Packages / Hotels / Flights / Events)
 *  â€¢ Responsive grid of featured destinations (ðŸ‡«ðŸ‡· ðŸ‡ªðŸ‡¸ ðŸ‡¯ðŸ‡µ etc.)
 *  â€¢ Clicking a card routes to /destinations/:code  (to be implemented)
 * ------------------------------------------------------------------ */

/* palette */
const blue = "#175dff", light = "#d8edff", dark = "#003b70";

const fadeIn = keyframes`from{opacity:0;transform:translateY(10px)}to{opacity:1;transform:translateY(0)}`;

/* === layout === */
const Wrapper = styled.div`min-height:100vh;background:${light};display:flex;flex-direction:column;font-family:"Segoe UI",Tahoma,Verdana,sans-serif;`;

/* header */
const Header = styled.header`
  position:sticky;top:0;z-index:1000;background:#fff;box-shadow:0 2px 6px rgba(0,0,0,.08);
  display:flex;align-items:center;justify-content:space-between;padding:.8rem 2rem;
`;
const Logo = styled(Link)`display:flex;align-items:center;gap:.5rem;font-size:1.8rem;font-weight:700;color:${blue};text-decoration:none;`;
const Nav = styled.nav`display:flex;gap:1.5rem;align-items:center;`
const NavLink = styled(Link)`color:${dark};font-weight:500;text-decoration:none;position:relative;&::after{content:"";position:absolute;bottom:-4px;left:0;width:0;height:2px;background:${blue};transition:.3s} &:hover::after{width:100%}`;

/* grid */
const Grid = styled.section`
  display:grid;grid-template-columns:repeat(auto-fit,minmax(240px,1fr));gap:2rem;padding:3rem 2.5rem;width:100%;max-width:1400px;margin:0 auto;animation:${fadeIn}.6s ease-out;`;
const Card = styled.div`
  position:relative;border-radius:18px;overflow:hidden;cursor:pointer;height:250px;box-shadow:0 6px 14px rgba(0,0,0,.15);
  transition:transform .3s; &:hover{transform:translateY(-6px)}
`;
const CardImg = styled.img`width:100%;height:100%;object-fit:cover;object-position:center;`;
const Overlay = styled.div`
  position:absolute;inset:0;background:linear-gradient(to bottom,rgba(0,0,0,0) 40%,rgba(0,0,0,.55));`;
const CardLabel = styled.h3`
  position:absolute;bottom:1rem;left:1.2rem;color:#fff;font-size:1.4rem;font-weight:600;`;

export default function HomePage(){
  const navigate = useNavigate();

  // showcase data (could be fetched from backend)
  const destinations=[
    {code:"FR", name:"France", img:"https://images.unsplash.com/photo-1502602898657-3e91760cbb34?auto=format&fit=crop&w=1350&q=80"},
    {code:"ES", name:"Spain",  img:"https://images.unsplash.com/photo-1549640359-f38e76a3ba8b?auto=format&fit=crop&w=1350&q=80"},
    {code:"IT", name:"Italy",  img:"https://images.unsplash.com/photo-1504803543634-5f2f0f6a0691?auto=format&fit=crop&w=1350&q=80"},
    {code:"JP", name:"Japan",  img:"https://images.unsplash.com/photo-1505069467871-bd73c7ab7b53?auto=format&fit=crop&w=1350&q=80"},
    {code:"US", name:"USA",   img:"https://images.unsplash.com/photo-1500530855697-b586d89ba3ee?auto=format&fit=crop&w=1350&q=80"},
    {code:"BR", name:"Brazil", img:"https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d?auto=format&fit=crop&w=1351&q=80"},
  ];

  return(
    <Wrapper>
      {/* header */}
      <Header>
        <Logo to="/">
          <FaPlaneDeparture/> Bookify
        </Logo>
        <Nav>
          <NavLink to="/">Packages</NavLink>
          <NavLink to="/hotels">Hotels</NavLink>
          <NavLink to="/flights">Flights</NavLink>
          <NavLink to="/events">Events</NavLink>
        </Nav>
      </Header>

      {/* grid of featured destinations */}
      <Grid>
        {destinations.map(d=>(
          <Card key={d.code} onClick={()=>navigate(`/destinations/${d.code}`)}>
            <CardImg src={d.img} alt={d.name}/>
            <Overlay/>
            <CardLabel>{d.name}</CardLabel>
          </Card>
        ))}
      </Grid>
    </Wrapper>
  );
}
